# Inicializa o reconhecedor de fala
recognizer = sr.Recognizer()
def clean_and_join_transcription(text):
    # Remover descrições como "de Faca" após letras isoladas
    pattern = r"([a-zA-Z])\s+(de\s+\w+)"
    cleaned_text = re.sub(pattern, r"\1", text, flags=re.IGNORECASE)
    
    # Remover todos os espaços restantes
    no_space_text = cleaned_text.replace(" ", "")
    return no_space_text

# Carregar e transcrever o áudio
with sr.AudioFile(audio_file) as source:
    audio = recognizer.record(source)
    try:
        # Transcrever o áudio
        raw_text = recognizer.recognize_google(audio, language="pt-BR")
        print("Transcrição original:", raw_text)
        
        # Limpar a transcrição e remover espaços
        final_text = clean_and_join_transcription(raw_text)
        print("Transcrição final:", final_text)
        
    except sr.UnknownValueError:
        print("O serviço de reconhecimento não conseguiu entender o áudio")
    except sr.RequestError as e:
        print(f"Erro ao se conectar ao serviço de reconhecimento de fala: {e}")